import styled from '@emotion/styled';

const CarouselContainer = styled.div`
  transition: trasnform 0.5s;
`;

const CarouselInner = styled.div`
  width: 100vw;
  display: flex;
`;

const NonScroll = styled.div`
  overflow: hidden;
`;

export const Carousel = {
  CarouselContainer,
  CarouselInner,
  NonScroll,
};

export default Carousel;
